import logo from '../../assets/images/logo.svg'
import './login.scss'
import Typography from "@mui/material/Typography";
import CustomInput from './CustomInput.js'
import Box from "@mui/material/Box";
import Grid from '@mui/material/Grid';
import Button from '@mui/material/Button';
import { createTheme, ThemeProvider } from '@mui/material/styles';

const buttonTheme = createTheme({
    palette: {
        primary: {
            main: '#9146D8',
        },
        secondary: {
            main: '#D9D9D9',
        }
    }
})

export const Login = () => {
    return (
        <ThemeProvider theme={buttonTheme}>
            <Box sx={{ width: '31.25vw', height: '31.25vw', background: 'white', borderRadius: 'calc(0.1em + 1vw)' }}>
                <img className="logo_image" src={logo}></img>
                <Typography align="center" sx={{ position: 'relative', mt: "10%" }}>Log into your account, or sign up here!</Typography>
                <div className="login_input">
                    <CustomInput text="Username" />
                </div>
                <div className="login_input">
                    <CustomInput text="Password" />
                </div>
                <div className='login_button_grid'>
                    <Button variant='contained' color='secondary' sx={{ position: 'relative', borderRadius: 'calc(0.1em + 0.5vw)', pl:'2em', pr:'2em'}}>Create Account</Button>
                    <Button variant='contained' color='primary' sx={{ position: 'relative', borderRadius: 'calc(0.1em + 0.5vw)', pl:'2em', pr:'2em'}}>Sign In</Button>
                </div>
            </Box>
        </ThemeProvider>
    )
}
